import React from 'react';
import Container from '@mui/material/Container';
import Stack from '@mui/material/Stack';
import Button from '@mui/material/Button';
import AppBar from '@mui/material/AppBar';
import Typography from '@mui/material/Typography';


type NavbarProps = {
    transparent?: boolean;
};

export default class Navbar extends React.Component<NavbarProps> {
    public render(): JSX.Element {
        const elevation: number = this.props.transparent ? 0 : 3;
        const backgroundColor: 'primary' | 'transparent' = this.props.transparent ? 'transparent' : 'primary';
        const textColor: string = 'white';
        const containedBackgroundColor: string = this.props.transparent ? 'primary' : 'white';
        const containedTextColor: string = this.props.transparent ? 'white' : '#086788';

        return (
            <AppBar position="fixed" color={backgroundColor} elevation={elevation} sx={{ paddingY: 2, transition: '0.1s' }}>
                <Container>
                    <Stack direction="row" justifyContent="space-between">
                        <Typography variant="h6" color="white">
                            IWDS
                        </Typography>

                        <Stack direction="row" spacing={3} sx={{
                            display: { xs: 'none', md: 'block' },
                        }}>
                            <Button variant="text" sx={{ color: textColor }}>Free Estimate</Button>
                            <Button variant="text" sx={{ color: textColor }}>Services</Button>
                            <Button variant="text" sx={{ color: textColor }}>About</Button>
                            <Button variant="contained" sx={{
                                backgroundColor: containedBackgroundColor,
                                color: containedTextColor,
                            }}>
                                Contact Us
                            </Button>
                        </Stack>
                    </Stack>
                </Container>
            </AppBar>
        );
    }
}
